 Certainly! Here is a simple example of how to serve a ReactJS app from an ExpressJS server, using TypeScript.

First, let's create a new ReactJS app using the `create-react-app` command:
```sh
npx create-react-app my-react-app
```
This creates a new ReactJS app at `my-react-app`.

Next, let's create a new ExpressJS server using NodeJS and TypeScript:
```sh
npx tsc && node server.js
```
This creates a new ExpressJS server at `server.js` in the `node_modules` directory.

We'll need to modify `server.ts` to serve the ReactJS app:
```javascript
import express from 'express';
import React from 'react';
import { renderToString } from 'react-dom/server';
import App from './App';

const app = express();

app.get('/*', (req, res) => {
  const body = renderToString(<App />);
  res.send(`
    <!DOCTYPE html>
    <html>
      <head>
        <title>My React App</title>
      </head>
      <body>
        <div id="root">${body}</div>
        <script src="static/bundle.js"></script>
      </body>
    </html>
  `);
});

app.listen(3000, () => {
  console.log('Server listening on port 3000!');
});
```

