    addr.sin_addr.s_addr = htonl(INADDR_ANY);
    addr.sin_port = htons(888);
    bind(sd, (struct sockaddr *)&addr, sizeof(addr));
    listen(sd, 5);
    char buffer[2048];   // Assuming 2KB packets
    int bytes = recvfrom(sd, buffer, 2048, 0,
              (struct sockaddr *)&addr, &addr.sin_addr);
    if (bytes < 0){
        perror("recvfrom");
        return 1;
    }
    printf("Received %d bytes from %s:%d\n", bytes,
          inet_ntoa(addr.sin_addr), ntohs(addr.sin_port));
    return 0;
}
```
