Here is an example SvelteJS component that includes the logic to send a user's login credentials to the API endpoint you provided, and handle the response:
```typescript
// index.svelte

<script>
import { onMount } from 'svelte';

function sendLoginCredentials(username, password) {
	const xhr = new XMLHttpRequest();

	xhr.open('POST', 'https://mydomain.com/api/login');
	xhr.setRequestHeader('Content-Type', 'application/json');
	xhr.responseType = 'json';

	const payload = JSON.stringify({
		username,
		password
	});

	xhr.send(payload);
}

onMount(() => {
	const username = 'user';
	const password = 'password';
	sendLoginCredentials(username, password);
});
</script>

<button on:click={() => sendLoginCredentials('user', 'password')}>
	Log in
</button>
```
