```javascript
import React, { useState, useEffect } from 'react';

const Popup = ({ message, onClose }) => {
  const [open, setOpen] = useState(true);

  useEffect(() => {
    console.log('Effect ran');
    if (onClose) {
      onClose();
    }
  }, [open]);

  return (
    <div className={`popup ${open ? 'active' : ''}`}>
      {message}
    </div>
  );
};

export default Popup;
```
In this example, `Popup` is a functional component that takes two props: `message` and `onClose`. The `message` prop is used to display a message in the popup, and the `onClose` prop is used to close the popup.

The component uses `useState` to manage the `open` state, and `useEffect` to clean up when the popup is closed.

