// Load your data
const dataset = require('./data');

// Normalize the data
const normalizedData = dataset.map(row => {
  // Remove empty values
  row.forEach(cell => row[cell] || (row[cell] = NaN));
  // Calculate the mean and standard deviation
  const mean = row.reduce((prev, curr) => {
    return prev + curr;
  }, 0) / row.length;
  const std = Math.sqrt(row.reduce((prev, curr) => {
    return (prev - mean) ** 2 + (curr - mean) ** 2;
  }, 0) / row.length);
  // Normalize the values
  return row.map(value => (value - mean) / std);
});

